(1, 'create_account', 'Thanks for Registration', '<meta content=\"text/html; charset=UTF-8\" http-equiv=\"Content-Type\" />\r\n<title></title>\r\n<meta content=\"width=device-width, initial-scale=1.0\" name=\"viewport\" />\r\n<table border=\"0\" cellpadding=\"10\" cellspacing=\"0\" style=\"background-color: #FFFFFF\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><!--[if (gte mso 9)|(IE)]>\r\n      <table width=\"600\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n        <tr>\r\n          <td>\r\n    <![endif]-->\r\n			<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"content\" style=\"background-color: #FFFFFF\">\r\n				<tbody>\r\n					<tr>\r\n						<td id=\"templateContainerHeader\" mc:edit=\"welcomeEdit-01\" valign=\"top\">\r\n						<p style=\"text-align:center;margin:0;padding:0;\"><img height=\"38\" src=\"http://52.172.184.250/DEVELOPMENT/assets_tracking/admin/images/logoc.png\" style=\"display: inline-block;\" width=\"195\" /></p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\" valign=\"top\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"brdBottomPadd-two\" id=\"templateContainer\" width=\"100%\">\r\n							<tbody>\r\n								<tr>\r\n									<td class=\"bodyContent\" mc:edit=\"welcomeEdit-02\" valign=\"top\">\r\n									<p>Hi {username},</p>\r\n\r\n									<h2><strong>Congratulations on signing up<br />\r\n									for Assets Tracking!</strong></h2>\r\n\r\n									<h3>Thanking you for registration in Asset tracking system. We are committed to delivering a great experience for every user.Following are your login credentials</h3>\r\n									</td>\r\n								</tr>\r\n								<tr align=\"top\">\r\n									<td class=\"bodyContentImage\" valign=\"top\">\r\n									<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n										<tbody>\r\n											<tr>\r\n												<td align=\"left\" mc:edit=\"welcomeEdit-03\" style=\"margin:0;padding:0;\" valign=\"top\" width=\"50\">\r\n												<p style=\"margin-bottom:10px\"><img src=\"{imgurl}\" style=\"display:block;\" /></p>\r\n												</td>\r\n												<td align=\"left\" style=\"width:15px;margin:0;padding:0;\" valign=\"top\" width=\"15\">&nbsp;</td>\r\n												<td align=\"left\" mc:edit=\"welcomeEdit-04\" style=\"margin:0;padding-top:10px;line-height:1;\" valign=\"top\">\r\n												<h4><strong>Branch Name : {branch}</strong></h4>\r\n\r\n												<h4><strong>User Name : {email}</strong></h4>\r\n\r\n												<h4><strong>Password : {password}</strong></h4>\r\n												</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"brdBottomPadd-two \" id=\"templateContainerMiddle\" width=\"100%\">\r\n							<tbody>\r\n								<tr valign=\"top\">\r\n									<td align=\"center\" class=\"bodyContentTicks\">\r\n									<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n										<tbody>\r\n											<tr valign=\"top\">\r\n												<td mc:edit=\"welcomeEditImgFirst\" style=\"width:19%;color:#505050;font-family:Helvetica;font-size:14px;padding-bottom:1.143em;\" valign=\"top\">\r\n												<p style=\"text-align:center;margin:0 0 15px 0;padding:0;\"><img height=\"\" src=\"http://52.172.184.250/DEVELOPMENT/assets_tracking/admin/images/circle.jpg\" style=\"display:block;\" width=\"91\" /></p>\r\n												</td>\r\n												<td style=\"width:5%;\" valign=\"top\">&nbsp;</td>\r\n												<td mc:edit=\"welcomeEditTxtFirst\" style=\"width:71%;color:#505050;font-family:Helvetica;font-size:14px;padding-top:0.714em;\" valign=\"top\">\r\n												<h3><strong>Manage your Assets</strong></h3>\r\n\r\n												<h4>Add your assets into sytem by making purchase order and manage your assets.</h4>\r\n												</td>\r\n												<td style=\"width:5%;\" valign=\"top\">&nbsp;</td>\r\n											</tr>\r\n											<tr valign=\"top\">\r\n												<td mc:edit=\"welcomeEditImgFirst\" style=\"width:19%;color:#505050;font-family:Helvetica;font-size:14px;padding-bottom:1.143em;\" valign=\"top\">\r\n												<p style=\"text-align:center;margin:0 0 15px 0;padding:0;\"><img height=\"\" src=\"http://52.172.184.250/DEVELOPMENT/assets_tracking/admin/images/circle.jpg\" style=\"display:block;\" width=\"91\" /></p>\r\n												</td>\r\n												<td style=\"width:5%;\" valign=\"top\">&nbsp;</td>\r\n												<td mc:edit=\"welcomeEditTxtFirst\" style=\"width:71%;color:#505050;font-family:Helvetica;font-size:14px;padding-top:0.714em;\" valign=\"top\">\r\n												<h3><strong>Transfer your assets from one branch to Anather</strong></h3>\r\n\r\n												<h4>It is easy to share or transfer assets from one branch to anather.</h4>\r\n												</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\" valign=\"top\"><!-- BEGIN BODY // -->\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" id=\"templateContainerMiddleBtm\" width=\"100%\">\r\n							<tbody>\r\n								<tr>\r\n									<td class=\"bodyContent\" mc:edit=\"welcomeEdit-11\" valign=\"top\">\r\n									<p>If you have any questions about your account or any other matter, please feel free to contact us by phone at 7774077568(11 am to 7 pm).</p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						<!-- // END BODY --></td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\" class=\"unSubContent\" id=\"bodyCellFooter\" valign=\"top\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" id=\"templateContainerFooter\" width=\"100%\">\r\n							<tbody>\r\n								<tr>\r\n									<td mc:edit=\"wel