\r\n    body[yahoo] .buttonwrapper {\r\n    background-color:transparent!important\r\n    }\r\n\r\n    body[yahoo] .button {\r\n    padding:0!important\r\n    }\r\n\r\n    body[yahoo] .button a {\r\n    background-color:#e05443;\r\n    padding:15px 15px 13px!important\r\n    }\r\n\r\n    body[yahoo] .unsubscribe {\r\n    font-size:14px;\r\n    display:block;\r\n    margin-top:.714em;\r\n    padding:10px 50px;\r\n    background:#2f3942;\r\n    border-radius:5px;\r\n    text-decoration:none!important\r\n    }\r\n    }\r\n\r\n    @media only screen and (max-width: 480px),screen and (max-device-width: 480px) {\r\n      .bodyContentTicks {\r\n        padding:6% 5% 5% 6%!important\r\n      }\r\n\r\n      .bodyContentTicks td {\r\n        padding-top:0!important\r\n      }\r\n\r\n      h1 {\r\n        font-size:34px!important\r\n      }\r\n\r\n      h2 {\r\n        font-size:20px!important\r\n      }\r\n\r\n      h3 {\r\n        font-size:16px!important\r\n      }\r\n\r\n      h4 {\r\n        font-size:15px!important\r\n      }\r\n\r\n      h5 {\r\n        font-size:16px!important\r\n      }\r\n\r\n      h6 {\r\n        font-size:14px!important\r\n      }\r\n\r\n      p {\r\n        font-size:14px!important\r\n      }\r\n\r\n      .brdBottomPadd .bodyContent {\r\n        padding-bottom:2.286em!important\r\n      }\r\n\r\n      .brdBottomPadd-two .bodyContent {\r\n        padding-bottom:.857em!important\r\n      }\r\n\r\n      #templateContainerMiddleBtm .bodyContent {\r\n        padding:6% 5% 5% 6%!important\r\n      }\r\n\r\n      .bodyContent {\r\n        padding:6% 5% 1% 6%!important\r\n      }\r\n\r\n      .bodyContent img {\r\n        max-width:100%!important\r\n      }\r\n\r\n      .bodyContentImage {\r\n        padding:3% 6% 6%!important\r\n      }\r\n\r\n      .bodyContentImage img {\r\n        max-width:100%!important\r\n      }\r\n\r\n      .bodyContentImage h4 {\r\n        font-size:12px!important\r\n      }\r\n\r\n      .bodyContentImage h5 {\r\n        font-size:15px!important;\r\n        margin-top:0\r\n      }\r\n    }\r\n    .ii a[href] {color: inherit !important;}\r\n    span > a, span > a[href] {color: inherit !important;}\r\n    a > span, .ii a[href] > span {text-decoration: inherit !important;}\r\n</style>\r\n', '2018-08-20 16:03:27', '2018-08-20 16:03:27', 0);
INSERT INTO `mst_mail_body` (`id`, `type`, `mail_subject`, `mail_body`, `created`, `modified`, `modified_by`) VALUES
(3, 'quotation_update', 'Quotation Updates', '<meta content=\"text/html; charset=UTF-8\" http-equiv=\"Content-Type\" />\r\n<title></title>\r\n<meta content=\"width=device-width, initial-scale=1.0\" name=\"viewport\" />\r\n<table border=\"0\" cellpadding=\"10\" cellspacing=\"0\" style=\"background-color: #FFFFFF\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><!--[if (gte mso 9)|(IE)]>\r\n      <table width=\"600\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n        <tr>\r\n          <td>\r\n    <![endif]-->\r\n			<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"content\" style=\"background-color: #FFFFFF\">\r\n				<tbody>\r\n					<tr>\r\n						<td id=\"templateContainerHeader\" mc:edit=\"welcomeEdit-01\" valign=\"top\">\r\n						<p style=\"text-align:center;margin:0;padding:0;\"><img height=\"38\" src=\"http://52.172.184.250/DEVELOPMENT/assets_tracking/admin/images/logoc.png\" style=\"display: inline-block;\" width=\"195\" /></p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\" valign=\"top\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"brdBottomPadd-two\" id=\"templateContainer\" width=\"100%\">\r\n							<tbody>\r\n								<tr align=\"top\">\r\n									<td class=\"bodyContent\" mc:edit=\"welcomeEdit-02\" valign=\"top\">\r\n									<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"font-size: 12px;color:#505050;\">\r\n										<tbody>\r\n											<tr>\r\n												<td><strong>{shop_name}</strong><br />\r\n												Name : {name}<br />\r\n												Email : {email}<br />\r\n												Mobile : {mobile}<br />\r\n												Address : {address}</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"brdBottomPadd-two \" id=\"templateContainerMiddle\" width=\"100%\">\r\n							<tbody>\r\n								<tr valign=\"top\">\r\n									<td align=\"center\" class=\"bodyContentTicks\"><strong>Quotation Request</strong>\r\n									<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n										<tbody>\r\n											<tr>\r\n												<td style=\"color:#505050;font-family:Helvetica;font-size:12px;\"><b>Request No. :</b>{request_no}</td>\r\n												<td style=\"color:#505050;font-family:Helvetica;font-size:12px;\"><b>Request Date :</b>{request_date}</td>\r\n											</tr>\r\n											<tr>\r\n												<td colspan=\"3\">&nbsp;</td>\r\n											</tr>\r\n											<tr>\r\n												<td colspan=\"3\">\r\n												<p><b>Dear Sir,<br />\r\n												We are sorry to inform you that our requirement is change against request no {request_no}. Please ignore previous mail and send quotation against following requirements.</b></p>\r\n												</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n\r\n									<p><strong>List of Assets :</strong></p>\r\n									{html}</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\" valign=\"top\"><!-- BEGIN BODY // -->\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" id=\"templateContainerMiddleBtm\" width=\"100%\">\r\n							<tbody>\r\n								<tr>\r\n									<td class=\"bodyContent\" mc:edit=\"welcomeEdit-11\" valign=\"top\">\r\n									<p>If you have any questions or any other matter, please feel free to contact us by phone at 7774077568(11 am to 7 pm).</p>\r\n									</td>\r\n								</tr>\r\n								<tr>\r\n									<td class=\"bodyContent\" mc:edit=\"welcomeEdit-11\">\r\n									<p>Kind Regards,<br />\r\n									Assets Tracking</p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						<!-- // END BODY --></td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\" cl