(5, 'purchase_order', 'Purchase Order', '<meta content=\"text/html; charset=UTF-8\" http-equiv=\"Content-Type\" />\r\n<title></title>\r\n<meta content=\"width=device-width, initial-scale=1.0\" name=\"viewport\" />\r\n<table border=\"0\" cellpadding=\"10\" cellspacing=\"0\" style=\"background-color: #FFFFFF\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><!--[if (gte mso 9)|(IE)]>\r\n      <table width=\"600\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n        <tr>\r\n          <td>\r\n    <![endif]-->\r\n			<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"content\" style=\"background-color: #FFFFFF\">\r\n				<tbody>\r\n					<tr>\r\n						<td id=\"templateContainerHeader\" mc:edit=\"welcomeEdit-01\" valign=\"top\">\r\n						<p style=\"text-align:center;margin:0;padding:0;\"><img height=\"38\" src=\"http://52.172.184.250/DEVELOPMENT/assets_tracking/admin/images/logoc.png\" style=\"display: inline-block;\" width=\"195\" /></p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\" valign=\"top\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"brdBottomPadd-two\" id=\"templateContainer\" width=\"100%\">\r\n							<tbody>\r\n								<tr align=\"top\">\r\n									<td class=\"bodyContent\" mc:edit=\"welcomeEdit-02\" valign=\"top\">\r\n									<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"font-size: 12px;color:#505050;\">\r\n										<tbody>\r\n											<tr>\r\n												<td><strong>{shop_name}</strong><br />\r\n												Name : {name}<br />\r\n												Email : {email}<br />\r\n												Mobile : {mobile}<br />\r\n												Address : {address}</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"brdBottomPadd-two \" id=\"templateContainerMiddle\" width=\"100%\">\r\n							<tbody>\r\n								<tr valign=\"top\">\r\n									<td align=\"center\" class=\"bodyContentTicks\">&nbsp;\r\n									<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n										<tbody>\r\n											<tr>\r\n												<td style=\"color:#505050;font-family:Helvetica;font-size:12px;\"><b>Purchase Order No. :</b>{PO_number}</td>\r\n												<td style=\"color:#505050;font-family:Helvetica;font-size:12px;\"><b>Purchase Date :</b>{PO_date}</td>\r\n											</tr>\r\n											<tr>\r\n												<td style=\"color:#505050;font-family:Helvetica;font-size:12px;\"><b>Vendor :</b>{vendor}</td>\r\n												<td style=\"color:#505050;font-family:Helvetica;font-size:12px;\"><b>Quotation :</b>{quotation}</td>\r\n											</tr>\r\n											<tr>\r\n												<td colspan=\"4\">&nbsp;</td>\r\n											</tr>\r\n											<tr>\r\n												<td colspan=\"4\">\r\n												<p><b>Dear Sir,<br />\r\n												Following are the list of assets that we wish to purchase.</b></p>\r\n												</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n\r\n									<p><strong>Purchase Order :</strong></p>\r\n									{table}</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\" valign=\"top\"><!-- BEGIN BODY // -->\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" id=\"templateContainerMiddleBtm\" width=\"100%\">\r\n							<tbody>\r\n								<tr>\r\n									<td class=\"bodyContent\" mc:edit=\"welcomeEdit-11\" valign=\"top\">\r\n									<p>If you have any questions or any other matter, please feel free to contact us by phone at 7774077568(11 am to 7 pm).</p>\r\n									</td>\r\n								</tr>\r\n								<tr>\r\n									<td class=\"bodyContent\" mc:edit=\"welcomeEdit-11\">\r\n									<p>Kind Regards,<br />\r\n									Assets Tracking</p>\r\n									</td>\r\n								</tr>\r\n				